import React from 'react'

function Form() {
    return (
        <div>
            <form
                onSubmit={e => {
                    e.preventDefault();
                    alert('sended');
                }}
            >
                <input/>
                <button type="submit">Create</button>
            </form>
        </div>
    )
}

export default Form
